import { get, del, post, put } from "./HttpService";
import endpoints from "../config/endpoints";

export default class EmojiStateService {
  static search(dataSearch = { nextToken: "", limit: 10, query: {} }) {
    return get(endpoints.emojiStateManagement.list, dataSearch).then(value => {
      return value ? value.data : null;
    });
  }

  static remove(id) {
    return del(endpoints.emojiStateManagement.delete.replace(":ID", id)).then(value => {
      return value ? value.data : null;
    });
  }

  static get(id) {
    return get(endpoints.emojiStateManagement.get.replace(":ID", id)).then(value => {
      return value ? value.data : null;
    });
  }

  static update(id, item) {
    return put(endpoints.emojiStateManagement.update.replace(":ID", id), item).then(value => {
      return value ? value.data : null;
    });
  }

  static create(item) {
    return post(endpoints.emojiStateManagement.create, item).then(value => {
      return value ? value.data : null;
    });
  }
}
